import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Home from '../home/Home';
import Login from '../login/Login';
import Order from '../order/order';
import Setting from '../setting/setting';
import Customer from '../customer/Customer';
import GroupCustomer from '../customer/GroupCustomer';
import Debt from '../customer/Debt';
import ListEmployees from '../employees/ListEmployees';
import SignUp from '../sign_up/SignUp';
import AddEmployees from '../employees/AddEmployees';

const RouterUrl: React.FC = () => {
  return (
    <div>
        <Route exact path="/" component={Order} />
        <Route path="/login" component={Login} />
        <Route path="/order" component={Order} />
        <Route path="/setting" component={Setting} />
        <Route path="/customer" component={Customer} />
        <Route path="/group-customer" component={GroupCustomer} />
        <Route path="/debt-customer" component={Debt} />
        <Route path="/list-employees" component={ListEmployees} />
        <Route path="/sign-up" component={SignUp} />
        <Route path="/group-employees" component={AddEmployees} />
    </div>
  );
}

export default RouterUrl;
